t=0
x=96
y=24
flag=0

room=nil

function BOOT()
	room=room1
end

function TIC()
	b=0
	if btn(0) then 
		y=y-1 
	end
	if btn(1) then 
		y=y+1
	end
	if btnp(2,60,6) then 
		x=x-1
		b=1
	end
	if btnp(3,60,6) then 
		x=x+1
		b=2
	end

	if b>0 then
		change_room(b)
	end
	
	cls(0)
	draw_room(room)
	--draw_door(232,40)
end

function draw_room(room)
	draw_background(24,0)
	map(room.x,room.y,room.w,room.h,0,0,0,1)
	draw_decoration(room.decor)

	for i=1,room.n_exts do
		if room.exts[i].decor==1 then
			draw_door(room.exts[i].x1, room.exts[i].y1)
		end
	end

end

function draw_background(x,y)
	for i=0,3 do
		spr(192,x,y,-1,1,0,0,12,2)
		spr(224,x+96,y,-1,1,0,0,12,2)
		y=y+16
		spr(224,x,y,-1,1,1,0,12,2)
		spr(192,x+96,y,-1,1,1,0,12,2)
		y=y+16
	end
	spr(192,x,y,-1,1,0,0,12,2)
	spr(224,x+96,y,-1,1,0,0,12,2)
end

function draw_decoration(decor)
	x=104
	y=32
	if decor~=0 then
		spr(202+decor*2,x,y,0,1,0,0,2,4)
		spr(202+decor*2,x+16,y,0,1,1,0,2,4)
	end
end

function draw_door(x,y)
	spr(47,x,y,0,1,0,0,1,4)
	spr(47,x,y+32,0,1,2,0,1,4)
end

function change_room(n)
	if room.n_exts<n then
		n=room.n_exts
	end

	if room.exts[n].to==1 then
		room=room1
	elseif room.exts[n].to==2 then
		room=room2
	elseif room.exts[n].to==3 then
		room=room3
	end
end

